import React from "react";

const SellerPage = () => {
  return (
    <section className="max-container my-10 max-lg:mx-10">
      <form action="" className="flex flex-col gap-10">
        <input type="text" className="input" placeholder="Product Name" />
        <input type="text" className="input" placeholder="Description"/>
        <input type="text" className="input" placeholder="Category"/>
        <input type="text" className="input" placeholder="Price" />
        <input type="number" className="input" placeholder="rating"/>
        <input type="text" className="input" placeholder="Discount in percentage" />
        <input type="text" className="input" />
      </form>
    </section>
  );
};

export default SellerPage;
